  a contract worker with SWCA Environmental Consultants, Inc. in winter 2012. All
  monitoring data is stored within the FEAT/FIREMON Integrated (FFI) database. Using
  the FFI GIS module (toolbar), monitoring plot location data are mapped as points
  in ArcGIS, using Datum, UTM Zone, UTME Coordinate, UTMN Coordinate information recorded
  into the FFI database. Summary attribute information for each plot point was added
  by joining an Excel spreadsheet table, created by Molly Cox.\",\n\t\"license_title\":
